import React, { Component } from 'react'
import RegisterParent from './registerParent'
import { Paper, Button } from '@material-ui/core'
import PersonAddIcon from '@material-ui/icons/PersonAdd';
import ErrorIcon from '@material-ui/icons/Error';

class RegisterMain extends Component{

    state = {
        showRegisterFlow: false,
        addType: null,
    }

    onReturn = () => {
        this.setState({showRegisterFlow: false})
        this.setState({addType: null})
    }

    render(){

        let welcomeStyle = {textAlign: 'center'}
        let buttonStyle = {marginRight: '30px', marginTop: '70px', fontSize: '25px', textAlign: 'left', width: '50%', justifyContent: 'left'}

        let welcome = 
        <div style={welcomeStyle}>
                <Button style={buttonStyle} onClick={() => {this.setState({showRegisterFlow: true})}}>
                <PersonAddIcon style={{fontSize: '60px', marginRight: '20px'}}/>
                    <span>Register a Parent Plate</span>
                </Button>
                <Button style={buttonStyle} onClick={() => {this.setState({showRegisterFlow: true})}}>
                    <ErrorIcon style={{fontSize: '60px', marginRight: '20px'}}/>
                    <span>Register a High Risk Plate</span>
                </Button>
        </div>

        let current = this.state.showRegisterFlow ? <RegisterParent onReturn={this.onReturn}/> : welcome

        return(
            <Paper style={{height: '650px', width: '100%', textAlign: 'center', backgroundColor: '#E5E5E5', paddingTop: '10%'}}>
                {current}
            </Paper>
        )
    }

}

export default RegisterMain
